import { Link } from "react-router-dom";

const Dropdown = ({ prods = false, links = false, discover = false }) => {
  return (
    <section className="fixed top-0 start-0 w-screen bg-slate-50 text-slate-950 z-40 max-h-[50vh]">
      <div className="flex px-24">
        <div className="w-3/4 grid grid-cols-3 gap-5 padding">
          {prods.map((item, index) => {
            console.log(item.links);
            return (
              <div key={index}>
                <img src={item.cover} alt={item.title} />
                <h4 className="font-bold text-center">{item.title}</h4>
                <p className="text-sm flex justify-between">
                  {item.links.map((link, index) => {
                    <Link to={link.to} key={index}>
                      {link.label}
                    </Link>;
                  })}
                </p>
              </div>
            );
          })}
        </div>
        <div className="w-1/4">
          <ul>
            {links.map((link, index) => (
              <li key={index}>
                <Link to={link.to}>{link.label}</Link>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </section>
  );
};

export default Dropdown;
